testResolve :: TestData
testResolve =
    tests
        1
        15
        [
            testVal "resolve - empty clause" (toClause []) (resolve 1 (toClause [1, 2, 3]) (toClause [])),
            testVal "resolve - literal not in second clause" (toClause [4]) (resolve 1 (toClause [1, 2, 3]) (toClause [4])),
            testVal "resolve - literal in second clause" (toClause [3, 4]) (resolve 1 (toClause [1, 2, 3]) (toClause [3, 4])),
            testVal "resolve - literal complement in second clause" (toClause [2, 3]) (resolve 1 (toClause [1, 2, 3]) (toClause [-1, 3])),
            testVal "resolve - full solve" (toClause []) (resolve (-1) 
                                                            (resolve 3
                                                                (resolve 2
                                                                    (resolve 1
                                                                        (toClause [1, 2, 3]) 
                                                                        (toClause [3, -1])) 
                                                                    (toClause [-2, 3])) 
                                                                (toClause [-3, -1])) 
                                                            (toClause [1])),
            testVal "resolve - partial solve" (toClause [-1, 2]) (resolve 3 
                                                                    (resolve 3
                                                                        (resolve 2
                                                                            (resolve 1
                                                                                (toClause [1, 2, 3]) 
                                                                                (toClause [3, -1])) 
                                                                            (toClause [-2, 3])) 
                                                                        (toClause [3, -1, 2])) 
                                                                    (toClause [-3]))
        ]

testLearn :: TestData
testLearn =
  let result1 = toClause [2, 3]
      clause1 = toClause [1, 2]
      actions1 = [Unit (-1) (toClause [-1, 3])]

      result2 = toClause [3, 4]
      clause2 = toClause [1, 2]
      actions2 =
        [ Unit (-1) (toClause [-1, 3]),
          Unit (-2) (toClause [-2, 4])
        ]

      result3 = toClause [1, 2]
      clause3 = toClause [1, 2]
      actions3 = [Pure 2, Decide 1]

      result4 = toClause [1, 2, 3]
      clause4 = toClause [1, 2, 3]
      actions4 = []

      result5 = toClause [-5, 6]
      clause5 = toClause [-5, 6]
      actions5 =
        [ Pure 3,
          Pure (-5),
          Decide (-7)
        ]

      result6 = toClause [5]
      clause6 = toClause [1, 4, 5]
      actions6 =
        [ Unit (-4) (toClause [-4, 1]),
          Unit (-1) (toClause [-1, 5]),
          Decide (-5)
        ]

      result7 = toClause [2, 3]
      clause7 = toClause [1, 2, 3]
      actions7 =
        [ Unit 3 (toClause [-5, 3]),
          Unit 5 (toClause [-4, 5]),
          Unit 4 (toClause [1, 4, 7]),
          Unit 2 (toClause [2, 7]),
          Unit (-1) (toClause [-1]),
          Decide (-7)
        ]
   in tests
        2
        15
        [ testVal "learn example1" result1 $ learn clause1 actions1,
          testVal "learn example2" result2 $ learn clause2 actions2,
          testVal "learn example3" result3 $ learn clause3 actions3,
          testVal "learn empty actions" result4 $ learn clause4 actions4,
          testVal "learn non-Unit actions" result5 $ learn clause5 actions5,
          testVal "learn mixed actions" result6 $ learn clause6 actions6,
          testVal "learn multiple clauses" result7 $ learn clause7 actions7
        ]

testSatisfy :: TestData
testSatisfy =
    tests
        3
        40
        [ testVal "satisfy example1" result1 $ satisfy formula1
        , testVal "satisfy example2" result2 $ satisfy formula2
        , testVal "satisfy example3" result3 $ satisfy formula3
        , testVal "satisfy example4" result4 $ satisfy formula4
        , testVal "satisfy example5" result5 $ satisfy formula5
        , testVal "satisfy example6" result6 $ satisfy formula6
        , testVal "satisfy unitary" resultUnitary $ satisfy formulaUnitary
        , testVal "satisfy forced" resultForced $ satisfy formulaForced
        , testVal "satisfy 2sat" result2sat $ satisfy formula2sat
        , testVal "satisfy 3sat" result3sat $ satisfy formula3sat
        ]
        where
            formula1 = toFormula [[1, 2], [-1]]
            result1 = (Just (Set.fromList [-1, 2])
                      , [ (Unit {getLiteral = 2, getClause = toClause [1,2]}, toExtendedFormula [])
                        , (Unit {getLiteral = -1, getClause = toClause [-1]}, Map.fromList [(toClause [2], toClause [1,2])])
                        , (NOP, Map.fromList [(toClause [-1], toClause [-1]), (toClause [1,2], toClause [1,2])])
                        ]
                      )

            formula2 = toFormula [[1, 2, 3], [2, -3], [-1]]
            result2 = (Just (Set.fromList [-1,2])
                      , [ (Pure {getLiteral = 2}, toExtendedFormula [])
                        , (Unit {getLiteral = -1, getClause = toClause [-1]},
                           Map.fromList [(toClause [-3,2], toClause [-3,2]), (toClause [2,3], toClause [1,2,3])])
                        , (NOP, toExtendedFormula [[-3, 2], [-1], [1,2,3]])
                        ]
                      )

            formula3 = toFormula [[-4, -2, 3], [-3, 1, 2], [-1, 4]]
            result3 = (Just (Set.fromList [-4,-3,-1])
                      , [ (Pure {getLiteral = -3}, toExtendedFormula [])
                        , (Unit {getLiteral = -1, getClause = toClause [-1,4]}, Map.fromList [(toClause [-3,2], toClause [-3,1,2])])
                        , (Decide {getLiteral = -4}, Map.fromList [(toClause [-3,1,2], toClause [-3,1,2]), (toClause [-1], toClause [-1,4])])
                        , (NOP, Map.fromList [(toClause [-4,-2,3], toClause [-4,-2,3]), (toClause [-3,1,2], toClause [-3,1,2]), (toClause [-1,4], toClause [-1,4])])
                        ]
                      )

            formula4 = toFormula [[-1, -2, 3], [-1, 4, -3], [-1, -4, 5], [-1, -5, -3], [1, 2, 4]]
            result4 = (Just (Set.fromList [-5,-4,-3,-2,1])
                      , [ (Unit {getLiteral = 1, getClause = toClause [1,2,4]}, toExtendedFormula [])
                        , (Decide {getLiteral = -2},
                           Map.fromList [(toClause [1], toClause [1,2,4])])
                        , (Decide {getLiteral = -3},
                           Map.fromList [(toClause [-2,-1], toClause [-2,-1,3]), (toClause [1,2], toClause [1,2,4])])
                        , (Decide {getLiteral = -4},
                           Map.fromList [(toClause [-3,-1], toClause [-3,-1,4]), (toClause [-2,-1,3], toClause [-2,-1,3]),
                                         (toClause [1,2], toClause [1,2,4])])
                        , (Decide {getLiteral = -5},
                           Map.fromList [(toClause [-4,-1], toClause [-4,-1,5]), (toClause [-3,-1,4], toClause [-3,-1,4]),
                                         (toClause [-2,-1,3], toClause [-2,-1,3]), (toClause [1,2,4], toClause [1,2,4])])
                        , (NOP,
                           Map.fromList [(toClause [-5,-3,-1], toClause [-5,-3,-1]), (toClause [-4,-1,5], toClause [-4,-1,5]),
                                         (toClause [-3,-1,4], toClause [-3,-1,4]), (toClause [-2,-1,3],toClause [-2,-1,3]),
                                         (toClause [1,2,4],toClause [1,2,4])])
                        ]
                      )

            formula5 = toFormula [[1], [-1]]
            result5 = (Nothing
                      , [ (Unit {getLiteral = -1, getClause = toClause [-1]}, Map.fromList [(toClause [], toClause [1])])
                        , (NOP, toExtendedFormula [[-1], [1]])
                        ]
                      )

            formula6 = toFormula [[-7, 1], [-5, 1], [-3, 4], [3, -4], [-1, 2], [1, 2], [5, 7, -2], [-6, 1, -2], [6, -1, -2]]
            result6 = (Just (Set.fromList [-7,-4,-3,1,2,5,6])
                      , [ (Unit {getLiteral = -3, getClause = toClause [-3,4]}, toExtendedFormula [])
                        , (Decide {getLiteral = -4}, Map.fromList [(toClause [-3],toClause [-3,4])])
                        , (Unit {getLiteral = 6, getClause = toClause [-2,-1,6]},
                           Map.fromList [(toClause [-4,3],toClause [-4,3]),(toClause [-3,4],toClause [-3,4])])
                        , (Unit {getLiteral = 2, getClause = toClause [-1,2]},
                           Map.fromList [(toClause [-4,3],toClause [-4,3]),(toClause [-3,4],toClause [-3,4]),
                                         (toClause [6],toClause [-2,-1,6])])
                        , (Unit {getLiteral = 1, getClause = toClause [-5,1]},
                           Map.fromList [(toClause [-4,3],toClause [-4,3]),(toClause [-3,4],toClause [-3,4]),
                                         (toClause [-2,6],toClause [-2,-1,6]),(toClause [2],toClause [-1,2])])
                        , (Unit {getLiteral = 5, getClause = toClause [5,7]},
                           Map.fromList [(toClause [-6,-2,1],toClause [-6,-2,1]),(toClause [-4,3],toClause [-4,3]),
                                         (toClause [-3,4],toClause [-3,4]),(toClause [-2,-1,6],toClause [-2,-1,6]),
                                         (toClause [-1,2],toClause [-1,2]),(toClause [1],toClause [-5,1]),(toClause [1,2],toClause [1,2])])
                        , (Decide {getLiteral = -7},
                           Map.fromList [(toClause [-6,-2,1],toClause [-6,-2,1]), (toClause [-5,1],toClause [-5,1]),
                                         (toClause [-4,3], toClause [-4,3]),(toClause [-3,4],toClause [-3,4]),
                                         (toClause [-2,-1,6],toClause [-2,-1,6]),(toClause [-2,5],toClause [-2,5,7]),
                                         (toClause [-1,2],toClause [-1,2]),(toClause [1,2],toClause [1,2]),(toClause [5],toClause [5,7])])
                        , (NOP,
                           Map.fromList [(toClause [-7,1],toClause [-7,1]),(toClause [-6,-2,1],toClause [-6,-2,1]),
                                         (toClause [-5,1],toClause [-5,1]),(toClause [-4,3],toClause [-4,3]),(toClause [-3,4],toClause [-3,4]),
                                         (toClause [-2,-1,6],toClause [-2,-1,6]),(toClause [-2,5,7],toClause [-2,5,7]),
                                         (toClause [-1,2],toClause [-1,2]),(toClause [1,2],toClause [1,2]),(toClause [5,7],toClause [5,7])])
                        ]
                      )

            formulaUnitary = toFormula [[-4, 3], [2], [4, 2], [3]]
            resultUnitary = (Just (Set.fromList [2,3])
                            , [ (Unit {getLiteral = 3, getClause = toClause [3]}, toExtendedFormula [])
                              , (Unit {getLiteral = 2, getClause = toClause [2]},
                                 Map.fromList [(toClause [-4,3],toClause [-4,3]),(toClause [3],toClause [3])])
                              , (NOP, toExtendedFormula [[-4, 3], [2], [2, 4], [3]])
                              ]
                            )

            formulaForced = toFormula [[-2, 4], [2], [-4]]
            resultForced = ( Nothing
                           , [ (Unit {getLiteral = -2, getClause = toClause [-2,4]}, Map.fromList [(toClause [],toClause [2])])
                             , (Unit {getLiteral = -4, getClause = toClause [-4]},
                                Map.fromList [(toClause [-2],toClause [-2,4]),(toClause [2],toClause [2])])
                             , (NOP, toExtendedFormula [[-4], [-2, 4], [2]])
                             ]
                           )

            formula2sat = toFormula [[1, -2], [-1, 2], [-1, -2], [1, -3]]
            result2sat = (Just (Set.fromList [-3,-2,-1])
                         , [ (Unit {getLiteral = -1, getClause = toClause [-1,2]},toExtendedFormula [])
                           , (Decide {getLiteral = -2}, Map.fromList [(toClause [-1],toClause [-1,2])])
                           , (Pure {getLiteral = -3}, toExtendedFormula [[-2, -1], [-2, 1], [-1, 2]])
                           , (NOP, toExtendedFormula [[-3, 1], [-2, -1], [-2, 1], [-1, 2]])
                           ]
                          )

            formula3sat = toFormula [[-5, -2, 3], [1, 2, 3], [-4, 1, 5], [-5, -3, 4], [-2, 1, 3], [-5, -4, -3],
                                     [-4, -1, 5], [-3, 4, 5], [-5, -1, 3], [1, 4, 5], [-1, 4, 5]]
            result3sat = (Nothing
                         , [ (Unit {getLiteral = -1, getClause = toClause [-5,-1,3]},
                              Map.fromList [(toClause [],toClause [1,2,3])])
                           , (Unit {getLiteral = -2, getClause = toClause [-5,-2,3]},
                              Map.fromList [(toClause [-1],toClause [-5,-1,3]),(toClause [1],toClause [1,2,3])])
                           , (Unit {getLiteral = -3, getClause = toClause [-5,-4,-3]},
                              Map.fromList [(toClause [-2],toClause [-5,-2,3]),(toClause [-2,1],toClause [-2,1,3]),
                                            (toClause [-1],toClause [-5,-1,3]),(toClause [1,2],toClause [1,2,3])])
                           , (Unit {getLiteral = 5, getClause = toClause [5]},
                              Map.fromList [(toClause [-3],toClause [-5,-4,-3]),(toClause [-2,1,3],toClause [-2,1,3]),
                                            (toClause [-2,3],toClause [-5,-2,3]),(toClause [-1,3],toClause [-5,-1,3]), (toClause [1,2,3],toClause [1,2,3])])
                           , (Unit {getLiteral = 4, getClause = toClause [4]},
                              Map.fromList [(toClause [-5,-3],toClause [-5,-4,-3]),(toClause [-5,-2,3],toClause [-5,-2,3]),
                                            (toClause [-5,-1,3],toClause [-5,-1,3]),(toClause [-2,1,3],toClause [-2,1,3]),
                                            (toClause [-1,5],toClause [-4,-1,5]),(toClause [1,2,3],toClause [1,2,3]),
                                            (toClause [1,5],toClause [-4,1,5]),(toClause [5],toClause [5])]),
                             (NOP, Map.fromList [(toClause [-5,-4,-3],toClause [-5,-4,-3]) ,(toClause [-5,-3,4],toClause [-5,-3,4]),
                                                 (toClause [-5,-2,3],toClause [-5,-2,3]),(toClause [-5,-1,3],toClause [-5,-1,3]),
                                                 (toClause [-4,-1,5],toClause [-4,-1,5]),(toClause [-4,1,5],toClause [-4,1,5]),
                                                 (toClause [-3,4,5],toClause [-3,4,5]),(toClause [-2,1,3],toClause [-2,1,3]),
                                                 (toClause [-1,4,5],toClause [-1,4,5]),(toClause [1,2,3],toClause [1,2,3]),
                                                 (toClause [1,4,5],toClause [1,4,5]),
                                                 (toClause [4],toClause [4]), (toClause [4,5],toClause [4,5]), (toClause [5],toClause [5])])
                           ]
                         )


